const Payment = () => {
// anong payment gateway ba gagamitin
// example lang to para sa flow
const handleBookNowClick = () => {
    const bookingDetails = {
      selectedService,
      date,
      time,
      name,
      email,
      contactNumber,
      paymentMethod,
    };
    navigate("/confirmation", { state: bookingDetails });
  };
}

export default Payment
